import React from 'react';
import {Line} from 'react-chartjs-2';
import {Chart as ChartJS} from 'chart.js/auto';


const options = {
  scales: {
    x: {
      title: {
        display: true,
        text: 'Date',
        color: 'white'
      }
    },
    y: {
      title: {
        display: true,
        text: 'Temperature'
      }
    }
  }
}

function LineChart({chartData}) {
  return (
    <Line data={chartData} options={options}/>
  )
}

export default LineChart
